//Combine Obect variables into string  and push to array codeList for display
for (var i = 0; i < allCodes.length; i++) {
  var CombStr = allCodes[i].Med + " - " + allCodes[i].Description;
  codeList.push(CombStr);
}

//Intialize Render of Code List
renderList();

//Check if subcodes is 0 (not foot specific), if true go to function adding plus button, if false go to function adding L/R feet buttons
function renderList(){
  for (var i = 0; i < allCodes.length; i++) {
    if(allCodes[i].lrStatus === "none"){
      plusItem(i);
    } else if (allCodes[i].lrStatus === "lr"){
      footItem(i);
    } else {
      otherItem(i);
    };
  };
};

//List codelist and add L/R foot icons
function footItem(num) {
  var list = document.getElementById('codes');

  var item = codeList[num];

  var li = document.createElement('li');
  li.classList.add('medCodes');
  li.innerText = item;

  var buttons = document.createElement('div');
  buttons.classList.add('buttons');
  buttons.classList.add('divider');

  var left = document.createElement('button');
  left.classList.add('leftFoot');
  left.innerHTML = leftSVG;

  left.addEventListener('click', listItem);

  var right = document.createElement('button');
  right.classList.add('rightFoot');
  right.innerHTML = rightSVG;

  right.addEventListener('click', listItem);

  buttons.appendChild(left);
  buttons.appendChild(right);
  li.appendChild(buttons);
  list.appendChild(li);
};

//List codelist and add plus button
function plusItem(num) {
  var list = document.getElementById('codes');

  var item = codeList[num];

  var li = document.createElement('li');
  li.classList.add('medCodes');
  li.innerText = item;

  var buttons = document.createElement('div');
  buttons.classList.add('buttons');

  var plus = document.createElement('button');
  plus.classList.add('plus');
  plus.innerHTML = plusSVG;

  plus.addEventListener('click', listItem);

  buttons.appendChild(plus);
  li.appendChild(buttons);
  list.appendChild(li);
};

//List codelist and add dropdown list
function otherItem(num){
  var list = document.getElementById('codes');
  var item = codeList[num];

  var li = document.createElement('li');
  li.classList.add('medCodes');
  li.innerText = item;

  var drop = document.createElement('div');
  drop.classList.add('dropDownList');

  var dropDownSub = document.createElement('select');
  dropDownSub.classList.add('dropDown');
  dropDownSub.setAttribute("id", allCodes[num].Med);

  var buttons = document.createElement('div');
  buttons.classList.add('buttons');

  var plus = document.createElement('button');
  plus.classList.add('plus');
  plus.innerHTML = plusSVG;

  plus.addEventListener('click', listItem);

  buttons.appendChild(plus);
  li.appendChild(buttons);

  var defaultOption = document.createElement('option');
  defaultOption.innerHTML = "--Select--";

  dropDownSub.appendChild(defaultOption);

  for (var i = 0; i < allCodes[num].subCodes.length; i++) {
  var option = document.createElement('option');
  var text = allCodes[num].subCodes[i][1];
  option.innerHTML = text;
  option.classList.add(i);
  dropDownSub.appendChild(option);
  };
  drop.appendChild(dropDownSub);

  if (allCodes[num].detailCodesLVL1 !== 0) {
    var defaultOption = document.createElement('option');
    defaultOption.innerHTML = "--Select--";

    var dropDownL1 = document.createElement('select');
    dropDownL1.classList.add('dropDownL1');
    dropDownL1.setAttribute("id", allCodes[num].Med + "1");
    dropDownL1.appendChild(defaultOption);

    for (var i = 0; i < allCodes[num].detailCodesLVL1.length; i++) {
    var optionL1 = document.createElement('option');
    var textL1 = allCodes[num].detailCodesLVL1[i][1];
    optionL1.innerHTML = textL1;
    optionL1.classList.add(i);
    dropDownL1.appendChild(optionL1);
    };

    drop.appendChild(dropDownL1);

    if (allCodes[num].detailCodesLVL2 !== 0) {
      var defaultOption = document.createElement('option');
      defaultOption.innerHTML = "--Select--";

      var dropDownL2 = document.createElement('select');
      dropDownL2.classList.add('dropDownL2');
      dropDownL2.setAttribute("id", allCodes[num].Med + "2");
      dropDownL2.appendChild(defaultOption);

      for (var i = 0; i < allCodes[num].detailCodesLVL2.length; i++) {
      var optionL2 = document.createElement('option');
      var textL2 = allCodes[num].detailCodesLVL2[i][1];
      optionL2.innerHTML = textL2;
      optionL2.classList.add(i);
      dropDownL2.appendChild(optionL2);
      };

      drop.appendChild(dropDownL2);
    }
  }

  li.appendChild(drop);
  list.appendChild(li);
};

//Move to outputList on click and insert remove button
function listItem(){

  var svgClass = this.classList;
  var value = this.parentNode.parentNode;
  var text = "";
  var inner = value.childNodes[0].nodeValue;
  var aryPos = codeList.indexOf(inner);

  //Check if left or right foot was pressed
  if(allCodes[aryPos].lrStatus === "none"){
    text = allCodes[aryPos].Description + " (ICD10-CM " + allCodes[aryPos].Med + ")";
  }else if(allCodes[aryPos].lrStatus === "lr"){
    if (svgClass.value === 'leftFoot') {
       text = allCodes[aryPos].Description + " (ICD10-CM " + allCodes[aryPos].Med + "2)";
    } else {
      text = allCodes[aryPos].Description + " (ICD10-CM " + allCodes[aryPos].Med + "1)";
    };
  } else {
    var grabSelect = document.getElementById(allCodes[aryPos].Med);
    var subPos = parseFloat(grabSelect.options[grabSelect.selectedIndex].classList);
    if (grabSelect.selectedIndex === 0) {
      window.confirm("Please Select Item From List to Proceed");
      return;
    }
    grabSelect.selectedIndex = 0;
    text = allCodes[aryPos].Description + " (ICD10-CM " + allCodes[aryPos].Med + allCodes[aryPos].subCodes[subPos][0];

    if (allCodes[aryPos].detailCodesLVL1 !== 0) {
      var grabSelect = document.getElementById(allCodes[aryPos].Med + "1");
      var L1Pos = parseFloat(grabSelect.options[grabSelect.selectedIndex].classList);
      if (grabSelect.selectedIndex === 0) {
        window.confirm("Please Select Item From List to Proceed");
        return;
      }
      grabSelect.selectedIndex = 0;
      text = text + allCodes[aryPos].detailCodesLVL1[L1Pos][0];

      if (allCodes[aryPos].detailCodesLVL2 !== 0) {
        var grabSelect = document.getElementById(allCodes[aryPos].Med + "2");
        var L2Pos = parseFloat(grabSelect.options[grabSelect.selectedIndex].classList);
        if (grabSelect.selectedIndex === 0) {
          window.confirm("Please Select Item From List to Proceed");
          return;
        }
        grabSelect.selectedIndex = 0;
        text = text + allCodes[aryPos].detailCodesLVL2[L2Pos][0];
      }
    }

    text = text + ")";
  };

  var target = document.getElementById('outputList');
  var li = document.createElement('li');
  li.innerText = text;

  var buttons = document.createElement('div');
  buttons.classList.add('buttons');

  var remove = document.createElement('button');
  remove.classList.add('remove');
  remove.innerHTML = removeSVG;

  remove.addEventListener('click', removeItem);

  outputList.push(text);

  //Render Output List
  buttons.appendChild(remove);
  li.appendChild(buttons);
  target.appendChild(li);
};

//Remove from outputList on click
function removeItem(){
  var item = this.parentNode.parentNode;
  var parent = item.parentNode;
  var id = parent.id;
  var value = item.innerText;

  outputList.splice(outputList.indexOf(value),1);
  parent.removeChild(item);
};

//Generate Code List from outputList on click
function generateCodes(){

  let span = document.getElementById('myPopup');
  span.innerHTML = "";
  //List all available codes
  outputList.forEach((item) => {
    let para = document.createElement('p');
    para.innerText = item;
    span.appendChild(para);
  });

  span.classList.toggle("show");
};

//Clear Output List on Click
function clearList(){
outputList = [];
 document.getElementById('outputList').innerHTML = "";
};

//Generate Code List from outputList on click
let gen = document.getElementById('genCodes');
gen.addEventListener('click', generateCodes);

//Clear Output List on Click
let clear = document.getElementById('clearList');
clear.addEventListener('click', clearList);

//Search Box
function search_medCodes() {
  let input = document.getElementById('searchbar').value
  input = input.toLowerCase();
  let x = document.getElementsByClassName('medCodes');

  for (i = 0; i < x.length; i++) {
      if (!x[i].innerHTML.toLowerCase().includes(input)) {
          x[i].style.display="none";
      }
      else {
          x[i].style.display="list-item";
      };
    };
};
